import React from 'react';
import useTime from './useTime';

const App = () => {
  const { timer, randomNumber, isMultiple } = useTime();

  return (
    <div className="App">
      {timer}
      <br />
      {randomNumber}
      <br />
      {isMultiple ? 'Acerto' : ''}
    </div>
  );
};

export default App;
